        "content": "1\t产品简介 1.1\t产品概述 智能管控系统（MSPAD），全面实现终端管理自动化，涵盖终端配置、Windows系统备份/还原、Windows软件分发、Windows Agent升级、升腾Linux系统升级、升腾Linux补丁升级、升腾Linux Agent升级、安卓系统升级、自动配置、自动升级、远程维护等多项功能；通过本系统，能够高效运维管控，解决IT管理者面临的终端部署、维护、配置等问题，同时通过集中管理，能够对企业IT资源管理高度整合，提高企业IT管理效率。 升腾云终端管理系统主要包含以下五个模块： >>基本管理：该模块是对终端管理的基础数据进行管理，包含终端分组的增删改查、终端的增删改查操作，以及仅支持单台操作的日志提取操作； >>部署：实现对终端的系统升级、管理Agent升级、系统备份、系统还原、终端配置模板分发等操作； >>策略：实现智能管理过程中终端自动升级、模板自动分发两种策略的管理和配置； >>审计：详尽记录管理员的操作、终端上下线以及终端本地外设拔插的操作记录； >>任务：管理系统的任务管理中心，完成查看、分析、维护手动添加任务操作。 1.2\t产品特性 \t >>快速配置终端属性。 >>批量安装应用软件。 >>实时监控终端运行情况。 >>制定管理计划，对终端自动、定期执行特定管理操作而无需人工干预。 >>用户的控制及权限的划分。",
