        "content": "3.1.2\t终端分组 终端组分类 默认有两个固定的分组：  >>全部终端 所有终端组的父组，可以添加修改子组，用户不可删除该组。 >>未分组终端 未指定分组的终端都包含在该组下，可以添加修改子组，用户不可删除该组。 3.1.2.1\t添加组 1、单击“终端管理->管理终端”，选中“终端树”节点，右键特定的终端组。 此步骤可以参考如下链接http://mspad.com/picture_3-5 2、在“添加分组”面板中输入分组名称，点击“确定”。 此步骤可以参考如下链接http://mspad.com/picture_3-6 3.1.2.2\t删除组 >>要删除的分组下若包含终端或子组，应先将终端、子组删除或将终端移至其他组，才能进行组的删除。 1、单击终端管理->管理终端，选中“终端树”节点，右键特定的终端组，并单击“删除分组”。此步骤可以参考如下链接http://mspad.com/picture_3-7 2、选择删除类型，删除终端组及其下所有终端或删除终端组（组下终端移至未分组） 此步骤可以参考如下链接http://mspad.com/picture_3-8 3.1.2.3\t修改组 1、终端树选择终端组，右键显示操作菜单。 此步骤可以参考如下链接http://mspad.com/picture_3-9 2、修改组信息，单击“确定”完成修改，单击“取消”取消修改。 此步骤可以参考如下链接http://mspad.com/picture_3-10",
