        "content": "3.1.6\t终端操作 >>使用终端迁移功能，管理员对已管理的终端修改服务器地址和端口。 导航区域，终端管理 > 管理终端 > 勾选所要下发任务的终端 > 操作->操作类型选择迁移终端->创建任务名称->设置任务时间->设置新服务器地址和端口->单击提交生成任务 3.1.6.1\t操作步骤 1、操作类型选择 此步骤可以参考如下链接http://mspad.com/picture_3-17 2、创建任务名称 此步骤可以参考如下链接http://mspad.com/picture_3-18 3、设置任务时间 此步骤可以参考如下链接http://mspad.com/picture_3-19 4、 设置参数，点击提交即可下发任务。 A.\t发送通知 >>标题和内容必填         此步骤可以参考如下链接http://mspad.com/picture_3-20 B.\t时间设置 >>自动调整时间，需填写自动获取时间的IP地址           此步骤可以参考如下链接http://mspad.com/picture_3-21 C.\t网络设置 >>配置DHCP及DNS地址，DNS地址自动设置则不需要填写首选DNS服务器 此步骤可以参考如下链接http://mspad.com/picture_3-22 D.\t电源管理 >>启用电源管理；选择参数。 此步骤可以参考如下链接http://mspad.com/picture_3-23 E.\t外设管理 >>选择外设启用与否，提交后终端需重启才会生效。 此步骤可以参考如下链接http://mspad.com/picture_3-24 F.\t安全设置 此步骤可以参考如下链接http://mspad.com/picture_3-25 G.\t进程黑名单 >>启用进程黑名单，可选择黑名单分组，点击编辑可调至《高级管理-黑名单管理》中编辑黑名单进程及分组 此步骤可以参考如下链接http://mspad.com/picture_3-26 H.\tWEB安全 >>启用WEB监控，可自行添加黑名单域名。 此步骤可以参考如下链接http://mspad.com/picture_3-27 I.\t电源控制 >>操作可选择重启、关机、远程唤醒；进而配置参数。 此步骤可以参考如下链接http://mspad.com/picture_3-28 J.\tAgent密码 此步骤可以参考如下链接http://mspad.com/picture_3-29 K.\t日志收集 >>直接点击提交即可收集日志。 此步骤可以参考如下链接http://mspad.com/picture_3-30 L.\t终端升级 >>选择升级类型后选择升级文件及对应参数。 此步骤可以参考如下链接http://mspad.com/picture_3-31 M.\t性能告警 此步骤可以参考如下链接http://mspad.com/picture_3-32 N.\t提取镜像 >>设置提取的镜像名称及描述。 此步骤可以参考如下链接http://mspad.com/picture_3-33",
