        "content": "3.2.2\t自动搜索 >>配置MSPAD的自动扫描功能，自动扫描指定的网段中是否存在未被加入管理的终端。未被加入管理的终端，根据终端的IP自动加入到对应的组（或者所有终端组）。 说明： 1.系统初始默认关闭自动扫描功能，需手动配置扫描规则后开启扫描方可自动扫描终端。 2.当系统中没有配置扫描的IP段时，系统不会进行任何扫描。 此步骤可以参考如下链接http://mspad.com/picture_3-37 3.2.2.1\t添加 >>选择启用与否及搜索规则（每天、每周、按小时） >>根据不同的搜索规则选择搜索时间 此步骤可以参考如下链接http://mspad.com/picture_3-38 说明 建议配置的一个IP段范围最多只包含4个C类网段。例：192.168.1.0~192.168.4.255。 3.2.2.2\t编辑 >>可点击列表右侧编辑进行修改。 3.2.2.3\t删除 >>勾选需要删除的自动搜索规则，点击删除即可。 3.2.2.4\t修改状态 >>点击列表中状态列的开关选择自动搜索规则的启用与禁用",
