        "content": "3.6\t云桌面管理 3.6.1\t终端别名 1、选中所要重命名的终端，点击“重命名”。 此步骤可以参考如下链接http://mspad.com/picture_3-53 2、在“重命名终端”窗口中，设置终端别名，单击“确定”。 此步骤可以参考如下链接http://mspad.com/picture_3-54 3.6.2\t删除终端 1、勾选或全选所要删除的终端，点击“删除”。 此步骤可以参考如下链接http://mspad.com/picture_3-55 2、在提示对话框中单击“确定”。 此步骤可以参考如下链接http://mspad.com/picture_3-56 3.6.3\t移动终端 1、列表选中一台或多台终端，选择“移动”按钮。 2、在弹出的对话框中选中目标组，并单击“确定”保存。 此步骤可以参考如下链接http://mspad.com/picture_3-57 3.6.4\t终端操作 >>管理员对已管理的终端进行定时或立即执行应用推送及补丁升级。 >>勾选终端或勾选终端组，点击操作按钮即可发布任务。 3.6.4.1\t操作步骤 1、操作类型选择 此步骤可以参考如下链接http://mspad.com/picture_3-58 2、创建任务名称 此步骤可以参考如下链接http://mspad.com/picture_3-59 3、设置任务时间 此步骤可以参考如下链接http://mspad.com/picture_3-60 4、 设置参数，点击提交即可下发任务。 a、 应用推送 此步骤可以参考如下链接http://mspad.com/picture_3-61 b、补丁升级 此步骤可以参考如下链接http://mspad.com/picture_3-62 3.6.5\t导出 >>点击导出按钮，即可根据搜索结果导出终端列表。",
