        "content": "8\t个性化功能 8.1\tICMS >>用于管理IC卡及指纹信息，查看ICMS的认证日志及配置日志保留时间。 8.1.1\tIC卡&指纹管理 >>管理IC卡/指纹的状态及查看IC卡/指纹信息。 此步骤可以参考如下链接http://mspad.com/picture_8-1 8.1.1.1\t批量修改状态 >>勾选列表需要修改的状态，点击批量修改状态按钮，即可选择启用/禁用进行修改状态。 此步骤可以参考如下链接http://mspad.com/picture_8-2 8.1.1.2\t删除 >>勾选需删除的IC卡/指纹，点击删除按钮，确定即可删除。 8.1.1.3\t导入数据 >>点击导入按钮，可选择新增数据或清空原数据后导入。 此步骤可以参考如下链接http://mspad.com/picture_8-3 8.1.1.4\t导出数据 >>点击导出按钮，即可导出ICMS信息 8.1.2\tICMS认证日志 >>查看ICMS的操作日志，及操作状态、时间及详细信息。 8.1.2.1\t详细信息 >>点击列表操作列详细信息按钮，即可查看操作卡或指纹信息 此步骤可以参考如下链接http://mspad.com/picture_8-4 8.1.3\tICMS配置 >>配置日志保留时间。 >>选择保留时间，最短90天，最长180天。点击保存按钮即可。 此步骤可以参考如下链接http://mspad.com/picture_8-5",
